import React from 'react'

const Login = () => {
  const handleFormSubmit = (e) => {
    e.preventDefault()

    let email = e.target.elements.email?.value
    let password = e.target.elements.password?.value

    console.log(email, password)
  }
  return <div></div>
}

export default Login
